var font =
  '';
var callAddFont = function () {
  this.addFileToVFS('Inter_28pt-Medium-normal.ttf', font);
  this.addFont('Inter_28pt-Medium-normal.ttf', 'Inter_28pt-Medium', 'normal');
};

// Support both global jsPDF and UMD module
if (typeof jsPDF !== 'undefined') {
  jsPDF.API.events.push(['addFonts', callAddFont]);
} else if (
  typeof window !== 'undefined' &&
  window.jspdf &&
  window.jspdf.jsPDF
) {
  window.jspdf.jsPDF.API.events.push(['addFonts', callAddFont]);
}
